cim:FunctionDescriptor.cim:FunctionDescriptor.equation:
model Output_Limiter_and_Transformation_Polar_to_xy_3

equation

	yx = Selfix(Balanced(), 0.0, mag*cos(theta));
	yy = Selfix(Balanced(), 0.0, mag*sin(theta));

end Output_Limiter_and_Transformation_Polar_to_xy_3;

function Selfix
	input Boolean boolexpr;
	input Real x;
	input Real y;
	output Real outputexpr;
	parameter Real initializedVariable;
algorithm
	initializedVariable = conditionalInitialization(boolexpr);
	if initializedVariable then
		outputexpr = x;
	else
		outputexpr = y;
	end if;
end Selfix;

function Balanced
	parameter Integer domainType (start=1);
	output Boolean yo;
algorithm
	domainType = 1; // 1 for Balanced RMS, 2 for unBalanced RMS, 3 for EMT simulation
	if domainType = 1 then
		yo = True;
	else
		yo = False;
	end if;
end Balanced;

cim:FunctionDescriptor.cim:FunctionDescriptor.initialConditions:
Real phi1_inc (start = atan2(sinphi1,cosphi1)-phif);
Real uconv_1d_ltd (start = Selfix(BoolRMS(),  uconv_r*cosphi1 + uconv_i*sinphi1, uconv_r*cos(phi1_inc) + uconv_i*sin(phi1_inc)));
Real uconv_1q_ltd (start = inc(uconv_1q_ltd) = Selfix(BoolRMS(), -uconv_r*sinphi1 + uconv_i*cosphi1, -uconv_r*sin(phi1_inc) + uconv_i*cos(phi1_inc)));
Real uconv_1 (start = sqrt(max(0.0, Sqr(uconv_r)+Sqr(uconv_i))));
Real uconv_1d (start = Selfix(BoolRMS(),  uconv_r*cosphi1 + uconv_i*sinphi1, uconv_r*cos(phi1_inc) + uconv_i*sin(phi1_inc)));
Real uconv_1q (start = Selfix(BoolRMS(), -uconv_r*sinphi1 + uconv_i*cosphi1, -uconv_r*sin(phi1_inc) + uconv_i*cos(phi1_inc)));
// Initial condition for EMT simulation to be improved for unbalanced cases:
Real uconv_2d (start = Selfix(Balanced(), 0.0, Selfix(BoolRMS(),  uconv_2r*cosphi2+uconv_2i*sinphi2, 0.0)));
Real uconv_2q (start = Selfix(Balanced(), 0.0, Selfix(BoolRMS(), -uconv_2r*sinphi2+uconv_2i*cosphi2, 0.0)));
Real ur_haf_ref (start = 0);
Real ui_haf_ref (start = 0);
Real uconv_2r;
if noEvent(abs(uconv_2r))) < 1e-6 then
    uconv_2r = 0;
end if;
Real uconv_2i;
if noEvent(abs(uconv_2i))) < 1e-6 then
    uconv_2i = 0;
end if;
Real cosphi2;
if noEvent(abs(cosphi2))) < 1e-6 then
    cosphi2 = 1;
end if;
Real sinphi2;
if noEvent(abs(sinphi2))) < 1e-6 then
    sinphi2 = 0;
end if;
Real cosphi21;
if noEvent(abs(cosphi21))) < 1e-6 then
    cosphi21 = 1;
end if;
Real sinphi21;
if noEvent(abs(sinphi21))) < 1e-6 then
    sinphi21 = 0;
end if;
Real phif;
if noEvent(abs(phif))) < 1e-6 then
    phif = 0;
end if;

cim:FunctionDescriptor.cim:FunctionDescriptor.equation:
model Output_Limiter_and_Transformation_dq-Back

equation
	// dq Backwards Transformation of positive sequence component
	// In RMS simulation: Output considers positive sequence component only
	// In EMT simulation: Output considers positive and negative sequence components
	y1r = y1d*cosphi1 - y1q*sinphi1;
	y1i = y1d*sinphi1 + y1q*cosphi1
	yr = Selfix(BoolRMS(), y1r, y1r + y2r);
	yi = Selfix(BoolRMS(), y1i, y1i + y2i);

end Output_Limiter_and_Transformation_dq-Back;

function Selfix
	input Boolean boolexpr;
	input Real x;
	input Real y;
	output Real outputexpr;
	parameter Real initializedVariable;
algorithm
	initializedVariable = conditionalInitialization(boolexpr);
	if initializedVariable then
		outputexpr = x;
	else
		outputexpr = y;
	end if;
end Selfix;

function BoolRMS
	parameter Integer domainType (start=1);
	output Boolean yo;
algorithm
	domainType = 1; // 1 for RMS, 0 for EMT simulation
	if domainType = 1 then
		yo = True;
	else
		yo = False;
	end if;
end BoolRMS;

model Output_Limiter_and_Transformation_xy_to_polar_3

equation

	mag = Selfix(balanced(), 0.0, sqrt(max(0.0,Sqr(re)+Sqr(im))));
	theta = Selfix(Balanced(), 0.0, atan2(im,re)); // Output is in radians, ranging between (-pi,pi].

end Output_Limiter_and_Transformation_xy_to_polar_3;

