end Selfix;

model Output_Limiter_and_Transformation_Maximum_Limiter_2

equation
	yo = Selfix(Balanced(), 0, max(ymin,min(ymax,yi)));

end Output_Limiter_and_Transformation_Maximum_Limiter_2;

