model Output_Limiter_and_Transformation_dq-Back_Neg._Seq.

equation
	// dq Backwards Transformation of negative sequence component

	y21d = Selfix(BoolRMS(), 0.0, y2d*cosphi21 - y2q*sinphi21);
	y21q = Selfix(BoolRMS(), 0.0, y2d*sinphi21 + y2q*cosphi21);

	y2r = Selfix(Balanced(), 0.0, Selfix(BoolRMS(), y2d*cosphi2 - y2q*sinphi2,  y21d*cosphi1 + y21q*sinphi1));
	y2i = Selfix(Balanced(), 0.0, Selfix(BoolRMS(), y2d*sinphi2 + y2q*cosphi2, -y21d*sinphi1 + y21q*cosphi1));

end Output_Limiter_and_Transformation_dq-Back_Neg;

